Куч бирликда!


Статистика маълумотлари бўйича Ўзбекистонда 317 мингдан ортиқ татарлар истиқомат қилади ва улардан 80%и ёшлар.

Аввал татар болалари ҳеч қаерда мулоқат қила олмасдилар. Лекин вақт ўтиб бу нарса Интернет алоқасида «Ўзбекистон татарлари» гуруҳини яратилишига тутртки бўлди.
Бошида гуруҳ бевосита on-line орқали мулоқотни олиб борганлар. Қатнашувчилар сони сезиларли даражада ўсиб борди ва айнан 18 январь куни ёшлар ҳаётини ўзгартириб юборган биринчи учрашув бўлиб ўтди.

Ўзбекистон татар ёшлари ташкилотиниг яратилиш ғояси.


Ўзбекистон татар ёшлари ташкилотиниг яратилиш ғояси- дўстона учрашув ва суҳбат вақтида юзага келди. Шу борада белги яратилиб, ном ўйлаб топилди.

Гуруҳнинг бир йил мавжудлиги давомида кўп нарсалар қилинди.

Гуруҳнинг ҳаётфаолияти.


Гуруҳнинг ҳаётфаолияти қуйидагиларни ўз ичига олади:

    * Ҳайр-эхсон тадбирлари;
    * Маданий тадбирлар;
    * Кўнгилочар тадбирлар;
    * Маърифий тадбирлар ва бошқалар.



Гуруҳ фаолиятида қуйидагилар олиб борилмоқда:

    * Татарлар тарихи бўйича маърузалар;
    * Тошкент шаҳри бўйича экскурсиялар;
    * Тоғларга сайёхат;
    * Дискотекалар;
    * Ижтимоий ёрдам, ҳайр-эхсон;
    * Концертлар;
    * Спектакллар қўйилиши;
    * Ижодий кечалар;
    * Она тилини ўрганиш;
    * Дўстона учрашувлар;
    * Байрамлар ўтказиш ва бошқалар.



Бизнинг асосий ката тадбирларимиз.

2008 йил 15 март куни Тошкент шаҳар Киночилар Музейи биносида татар классики Газяа Исхакининг 130-йиллиги муносабати билан ижодий кеча бўлиб ўтди. Биринчи бор Ўзбекистонда унинг «Зулейха» номли қиссасига асосан татар тилида фильм намойиш этилди.Шу куни 400дан ортиқ одамлар еғилди, жумладан ижодий марказ вакиллари ҳамда давлат телевидинияси ва журналистлар. Группа фаоллари машҳур классикнинг биографияси ва ижодий ҳаёти бўйича маърузалар олиб бордилар, шу билан татар вакиллари юракларидан жой олдилар.

Шу йилнинг 9 май куни ҳам «Фаҳрийлар юрагидан жой ол!» акцияси бўлиб, унда аҳил гуруҳ болалари 170 Татар ВОВ рўйхатини яратиш борасида оғир вазифани бажардилар. Шу куни Тошкент шаҳри бўйлаб Ўзбекистон Татар Яшьляре вакиллари фаҳрийларни совғалар ва ёзма табрикномалар билан табрикладилар. Болалар ва фаҳрийлар эсталик учун фотосуръатларга тушдилар.

1 июнь-Болаларни ҳимоя қилиш кунида нутқ дефектли болалар боғчаси болалари васийлик остига олиндилар. Болалар совғалар билан тақдирланиб, улар миннатдорчиликлари юзасидан ўз қибилиятларини байрамона кўрсатув орқали намойиш этдилар.

Энг эсда қоладиган ёрқин кечалардан бири «Сабантуй-2008» бўлиб ўтди. 15 июнь куни Бобур паркида халқ ўйин кулгуси бўлди. Концерт дастурида ижодий гуруҳлар ва Тошкент меҳмонлари қатнашдилар. Татар ва Башкир маданий марказ устозлари назорати остида болалар турли туман конкурслар ўтказдилар.

18 июль куни Ўзбекистон Татар Ёшларини янада яқинлаштирган ярим йил ҳам ортда қолди. Шу куни Тельман паркида мини Сабантуй ўтказилди. Байрамда 200 дан ортиқ одам бўлиб, улардан маданий марказ вакиллари иштирок этди. Болаларнинг кучи билан группа фаоллари иштирокида концерт уюштирилди, ҳамда стол тенниси бўйича мусобақа олиб борилди ва ғолиб чиққанлар эсталик совғалари билан тақдирландилар. Байрам кўнгилдагидек бўлиб ўтди.

Август ойи охирида 3 чи Умумжаҳон Татар Ёшлари Форумига бутун Дуне бўйича татар ёшлари вакиллари ҳамда гуруҳ болалари еғилди. Бизнинг Ўзбекистон Татар Ёшлари энг фаол, ёрқин, креатив ва зукко бўлдилар.Бутун дунёга болалар Ўзбекистонни юқори даражада танаишдиртилар.

